let cairndhuPath = clubMemberData.clubs[0].cairndhu[0].path;
let clubInfo = clubMemberData.clubs[0];

function clubInfoData() {
    if (window.location.pathname === "/my-club/carnlough") {
        return clubInfo.carnlough[0].clubName;
    } else {
